pragma solidity ^0.5.10;

/**
* @title Proxy
* @author Disberse LTD
* @notice A delegatecall proxy that provides a setup function rather than a constructor. Tightly
* coupled with ProxyTarget.sol and Multisig.sol.
* @dev Any contract that expects to be delegatecalled by this proxy must reserve the 0th storage
* slot to avoid overwriting the proxy's target address.
*/
contract Proxy {

    /////
    // Storage:
    /////

    // The address to delegatecall all functions to.
    // *** Any proxy target must reserve the 0th storage slot ***
    address internal target;

    /////
    // Initialization function:
    /////

    // the address argument, sets it as the target, then forwards the rest of
    // the calldata to the proxy target with delegatecall (implemented)
    /**
    * @dev A setup function that replaces the constructor. Sets the target
    * address, then forwards the `setup` call to the target.
    * @param _forwardData The calldata to delegatecall to the target with
    * (Should include the `setup` function selector)
    * @param _target The target address to delegatecall to
    */
    function setup(
        bytes memory _forwardData,
        address _target
    )
        public
        payable
    {
        _setupProxy(_target);
        require(_forwardSetup(_forwardData, _target), "proxy-setup-failed");
    }

    /////
    // Internal functions:
    /////

    /**
    * @dev Checks that the target address has not already been set, then sets it to `_target`.
    * @param _target The target address to delegatecall to
    */
    function _setupProxy(address _target)
        internal
    {
        require(target == address(0), "target-set");
        require(_target != address(0), "invalid-target");
        target = _target;
    }

    /**
    * @dev Forwards the setup call to the target, so that any additional setup logic can be run.
    * @param _forwardData The calldata to delegatecall to the target with (should include the
    * `setup` function selector)
    * @param _target The target address to delegatecall to
    */
    function _forwardSetup(
        bytes memory _forwardData,
        address _target
    )
        internal
        returns (bool success)
    {
        assembly {
            // delegatecall to target with all remaining gas and the _forwardData
            // NOTE: mload(foo), for `foo` of bytes type, will return the first 32B which is 
            // encoded as the length of the array (in bytes).
            success := delegatecall(
                gas,                        // Pass remaining gas when calling the target.
                _target,                    // Contract address of the call target.
                add(_forwardData, 0x20),    // Offset to the start of input data.
                mload(_forwardData),        // Input data size (in bytes).  
                0,                          // No return data.
                0                           // See above.
            )
        }
    }

    /////
    // Fallback function
    /////

    /**
    * @dev Fallback function. Delegatecalls all calls to the target address
    */
    // TODO: refactor function into internal call?
    function () external payable {

        address _target = target;   // copy target onto stack

        assembly {

            // calldatacopy(dstOffset, calldataOffset, len)
            // copy all calldata into mem at offset 0x00
            calldatacopy(0, 0, calldatasize())

            // delegatecall(gas, dst, argsOffset, argsLen, retOffset, retLen)
            // delegatecall to target with all remaining gas, and the copied
            // calldata. Do not expect returndata copied into memory (because
            // we don't know the size of the expected returndata in advance)
            let success := delegatecall(gas, _target, 0, calldatasize(), 0, 0)

            // returndatacopy(dstOffset, returndataOffset, len)
            // manually copy the the return data into memory
            returndatacopy(0, 0, returndatasize())

            // if delegatecall encountered exception, revert with returndata
            if eq(success, 0) { revert(0, returndatasize()) }
            // else, return with returndata
            return(0, returndatasize())
        }
    }
}

